from datetime import datetime
from DateTime.DateTime import DateTime
import six
MAX32 = int(2 ** 31 - 1)
def safe_callable(ob):

    try:
        ob.__class__
        try:
            return bool(ob.__call__)
        except AttributeError:
            return isinstance(ob, six.class_types)
    except AttributeError:
        return callable(ob)
def datetime_to_minutes(value, precision=1,
                        max_value=MAX32, min_value=-MAX32):
    if value is None:
        return value
    if isinstance(value, (str, datetime)):
        value = DateTime(value)
    if isinstance(value, DateTime):
        value = value.millis() / 1000 / 60  # flatten to minutes

    if precision > 1:
        value = value - (value % precision)
    value = int(value)
    if value > max_value or value < min_value:

        raise OverflowError(
            '{0} is not within the range of dates allowed.'.format(value))
    return value

package com.jnape.palatable.lambda.semigroup.builtin;
import com.jnape.palatable.lambda.functions.Fn1;
import com.jnape.palatable.lambda.semigroup.Semigroup;
import static com.jnape.palatable.lambda.functions.builtin.fn1.Id.id;
import static com.jnape.palatable.lambda.semigroup.builtin.MinBy.minBy;

public final class Min<A extends Comparable<A>> implements Semigroup<A> {
    private static final Min<?> INSTANCE = new Min<>();
    private Min() {
    }
    @Override
    public A apply(A x, A y) {
        return minBy(id(), x, y);
    }
    @SuppressWarnings("unchecked")
    public static <A extends Comparable<A>> Min<A> min() {
        return (Min<A>) INSTANCE;
    }
    public static <A extends Comparable<A>> Fn1<A, A> min(A x) {
        return Min.<A>min().apply(x);
    }
    public static <A extends Comparable<A>> A min(A x, A y) {
        return min(x).apply(y);
    }
}

