func mySqrt(x int) int {
	if x == 0 {
		return 0
	}
	approx := 0.5 * float64(x)
	for i := 0; i < 20; i++ {
		betterapprox := 0.5 * float64(approx+float64(x)/approx)
		approx = betterapprox
	}
