func removeDuplicates2(nums []int) int {

	if len(nums) < 3 {
		return len(nums)
	}

	left, right := 2, 2
	for right < len(nums) {
		if nums[left-2] != nums[right] {
			nums[left] = nums[right]
			left++
		}
		right++
	}
	return left
}

