func IndentWith(str string, indent string) string {
	nl := "\n"
	spl := strings.Split(str, nl)
	if spl[len(spl)-1] == "" {
		spl = spl[:len(spl)-1]
	}
	for idx, line := range spl {
		spl[idx] = indent + line
	}
	return strings.Join(spl, nl)
}

